Description: High temperatures are expected through Saturday. Maximum temperatures will exceed the 30-degree mark today with lows of around 20 degrees overnight tonight. Humidex values over 40 are expected this afternoon.

During times of high heat, your health or your families and neighbours' health can deteriorate rapidly.

The Ministère de la Santé et des Services sociaux du Québec, in cooperation with Environment and Climate Change Canada, recommends that you protect yourself from heat effects by taking the following actions:

Drink 6 to 8 glasses of water par day. Follow your physician's instructions regarding the amount of fluid to drink;
Avoid alcoholic beverages;
Spend at least 2 hours a day in air conditioned or cool places;
Take at least one shower or cool bath per day, or cool your skin several times per day with wet towels;
Limit physical activities;
Wear light clothes.

Be sure to:
Never leave a child or a baby alone in a vehicle or a closed room, even for a few minutes;
Check on your loved ones, especially those who are vulnerable or living alone.

If you have questions regarding your health condition, call Info-Santé at 8-1-1 or ask a health care provider. In case of an emergency, call 9-1-1.

For more information, visit the Government of Quebec's Portail santé mieux-etre at www.sante.gouv.qc.ca.

###

Heat warnings are issued when very high temperature or humidity conditions are expected to pose an elevated risk of heat illnesses, such as heat stroke or heat exhaustion.

